function makeStockData(stockPrice) {
    var stockdata=[];
    stockPrice.map(item=>
        {
            var stockdataArr = [];
            stockdataArr.push(item.date,item.low,item.high,item.open,item.close);
            stockdata.push(stockdataArr);
        });
    return stockdata;
}

export default makeStockData
